def lengthOfLongestSubstring(s):
        """
        :type s: str
        :rtype: int
        """
        count =0
        _=0
        while _ <len(s) :
            
            a=[]
            a.append(s[_])
            for i in range(_+1,len(s)):
                if s[i] in a:
                    count=max(count,len(a)) 
                    _=max(a.index(s[i]),_)
                    break
                else:
                    a.append(s[i])
                    count=max(count,len(a))
            count=max(count,len(a))
            _=_+1
        return count
